datamodel:
// This is your Prisma schema file,
// learn more about it in the docs: https://pris.ly/d/prisma-schema

generator client {
  provider = "dart run orm"
}

datasource db {
  provider = "mysql"
  url      = env("DATABASE_URL")
}

// Data model
model User {
  id String @id
  firstName String
  lastName String
  gender String
  identityCode String
  birthday String
  birthCity String
}
